import NavBar from '../Components/NavBar';

function App() {
  return (
    <>
      <div className="h-screen flex">
        <div className="m-auto">
          <div className="text-4xl font-bold">My Home Page</div>
        </div>
      </div>
    </>
  );
}

export default App;
